-- -----------------------------------------------------
-- Table `main`.`clinics`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `main`.`clinics` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(45) NOT NULL,
  `latitude` FLOAT NOT NULL,
  `longitude` FLOAT NOT NULL,
  `budget` DECIMAL(9,2) NOT NULL DEFAULT 0,
  `accessibility` TINYINT NULL DEFAULT 1,
  PRIMARY KEY (`id`))
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `main`.`patients`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `main`.`patients` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(45) NOT NULL,
  `surname` VARCHAR(45) NOT NULL,
  `residence` VARCHAR(45) NOT NULL,
  `birth` DATE NOT NULL,
  PRIMARY KEY (`id`))
ENGINE = InnoDB;


-- -----------------------------------------------------
