  `cronic` TINYINT NULL DEFAULT 0,
  `on_site` TINYINT NULL DEFAULT 1,
  `in_presence` TINYINT NULL DEFAULT 1,
  `cost` FLOAT NULL DEFAULT 0,
  `sessions_requests` INT NULL DEFAULT 1,
