USE `main`;
USE main;

CREATE OR REPLACE VIEW next_upcoming_appointments AS
WITH distances AS (
  SELECT
    -- Doctor
    dct.id                                              AS doctor_id,
    dct.name                                            AS doctor_name,
    dct.surname                                         AS doctor_surname,
    dct.specialization                                  AS doctor_specialization,

    -- Doctor’s experience
    de.specialization                                   AS doctor_experience_type,
    TIMESTAMPDIFF(YEAR, de.start, CURDATE())            AS years_of_experience,

    -- Doctor’s personal info
    TIMESTAMPDIFF(YEAR, dct.birth, CURDATE())           AS doctor_age,
    dct.residence                                       AS doctor_residence,

    -- Patient
    pt.id                                               AS patient_id,

    -- Availability slot
    av.id                                               AS availability_id,
    av.timestamp                                        AS appointment_timestamp,

    -- Clinic
    cl.id                                               AS clinic_id,
    cl.name                                             AS clinic_name,
    cl.accessibility                                    AS clinic_accessibility,
    cl.budget                                           AS clinic_budget,

    -- Visit type
    vs.id                                               AS visit_id,
    vs.type                                             AS visit_type,
    vs.name                                             AS visit_name,
    vs.cronic                                           AS visit_is_chronic,
    vs.on_site                                          AS visit_on_site,
    vs.in_presence                                      AS visit_in_presence,
    vs.cost                                             AS visit_cost,
    vs.sessions_requests                                AS visit_sessions_requests,
    vs.min_session_interval                             AS visit_min_session_interval,
    vs.max_session_interval                             AS visit_max_session_interval,

    -- Environmental condition (if any)
    ec.type                                             AS environment_condition_type,
    ec.start                                            AS condition_start,
    ec.end                                              AS condition_end,

    -- Distance (Haversine formula) between patient’s coordinates and clinic
    ROUND(
      6371 * 2 * ASIN(
        SQRT(
          POWER(
            SIN(
              (RADIANS(cl.latitude) - RADIANS(pc.latitude)) / 2
            ), 2
          )
          + COS(RADIANS(pc.latitude)) * COS(RADIANS(cl.latitude))
            * POWER(
              SIN(
                (RADIANS(cl.longitude) - RADIANS(pc.longitude)) / 2
              ), 2
            )
        )
      )
    , 2)                                                AS distance_km
  FROM main.patients        AS pt
  JOIN main.coordinates     AS pc ON pt.id = pc.patient_id
  JOIN main.availabilities  AS av
    ON av.available    = 1
   AND av.timestamp   >= UNIX_TIMESTAMP() + 86400         -- at least one day from now
   AND av.timestamp   <= UNIX_TIMESTAMP() + 31536000      -- within one year
  JOIN main.clinics        AS cl ON cl.id       = av.clinic_id
  JOIN main.visits         AS vs ON vs.id       = av.visit_id
  JOIN main.doctors        AS dct ON dct.id     = av.doctor_id
  LEFT JOIN main.environmental_conditions AS ec
    ON ec.clinic_id    = cl.id
   AND (
         (av.timestamp BETWEEN ec.start AND ec.end)
      OR (ec.start IS NULL AND ec.end IS NULL)
      OR (ec.start IS NULL AND av.timestamp <= ec.end)
       )
  JOIN main.doctors_experiences AS de
    ON dct.id         = de.doctor_id
),
ranked AS (
  SELECT
    *,
    -- Rank clinics by proximity for each patient + visit
    RANK() OVER (
      PARTITION BY patient_id, clinic_id, visit_id
      ORDER BY distance_km ASC
    ) AS distance_rank,

    -- Within each doctor, pick earliest slot
    RANK() OVER (
      PARTITION BY patient_id, visit_id, clinic_id, doctor_id
      ORDER BY appointment_timestamp ASC
    ) AS time_rank
  FROM distances
)
SELECT *
FROM ranked
WHERE distance_rank <= 10   -- up to ten nearest clinics
  AND time_rank = 1;        -- earliest slot per doctor;

SET SQL_MODE=@OLD_SQL_MODE;
