-- -----------------------------------------------------
-- Procedure to register a new patient
-- -----------------------------------------------------
use main;
DELIMITER $$

CREATE PROCEDURE register_patient(
    IN  p_first_name     VARCHAR(45),
    IN  p_last_name      VARCHAR(45),
    IN  p_residence      VARCHAR(45),
    IN  p_birth          DATE,
    IN  p_email          VARCHAR(45),
    IN  p_password       VARCHAR(128),
    IN  p_condition      VARCHAR(225),
    IN  p_difficulties   VARCHAR(225),
    IN  p_goals          VARCHAR(225),
    IN  p_technologies   VARCHAR(225),
    IN  p_environment    VARCHAR(225),
    IN  p_latitude       FLOAT,
    IN  p_longitude      FLOAT,
    OUT p_status         INT
)
BEGIN
    DECLARE v_count INT;

    -- Check if email already exists
    SELECT COUNT(*) INTO v_count
      FROM main.credentials
     WHERE email = p_email;

    IF v_count > 0 THEN
        -- Email already registered: failure
        SET p_status = 0;
    ELSE
        -- Insert into patients, credentials, personas, and coordinates
        START TRANSACTION;

        VALUES (p_first_name, p_last_name, p_residence, p_birth);
        SET @last_id = LAST_INSERT_ID();

        VALUES (@last_id, @last_id, p_email, p_password);

        VALUES (@last_id, @last_id, p_condition, p_difficulties, p_goals, p_technologies, p_environment);

        VALUES (@last_id, @last_id, p_latitude, p_longitude);

        COMMIT;
        SET p_status = 1;
    END IF;
END$$

DELIMITER ;


